import React, { useState } from 'react';
import {
  StyleSheet,
  Text,
  View,
  TextInput,
  TouchableOpacity,
  Alert,
  ScrollView,
  Image,
} from 'react-native';

const HotelScreen = () => {
  const [showForm, setShowForm] = useState(false);
  const [selectedHotel, setSelectedHotel] = useState('');
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [phone, setPhone] = useState('');
  const [checkIn, setCheckIn] = useState('');
  const [checkOut, setCheckOut] = useState('');
  const [guests, setGuests] = useState('');

  const hotels = [
    {
      id: 1,
      name: 'The Taj Mahal Palace',
      location: 'Mumbai',
      image: 'data:image/jpeg;base64,',
    },
    {
      id: 2,
      name: 'Oberoi Udaivilas',
      location: 'Udaipur',
      image: 'data:image/jpeg;base64,',
    },
    {
      id: 3,
      name: 'ITC Maurya',
      location: 'New Delhi',
      image: 'data:image/jpeg;base64,',
    },
    {
        id: 4,
        name: 'Leela Palace',
        location: 'Bengaluru',
        image: 'data:image/jpeg;base64,',
      },
      {
        id: 5,
        name: 'Rambagh Palace',
        location: 'Jaipur',
        image: 'data:image/jpeg;base64,',
      },
      {
        id: 6,
        name: 'Trident Hotel',
        location: 'Mumbai',
        image: 'data:image/jpeg;base64,',
      },
      {
        id: 7,
        name: 'Taj Falaknuma Palace',
        location: 'Hyderabad',
        image: 'data:image/jpeg;base64,',
      },
      {
        id: 8,
        name: 'Wildflower Hall',
        location: 'Shimla',
        image: 'data:image/jpeg;base64,',
      },
      {
        id: 9,
        name: 'Evolve Back',
        location: 'Coorg',
        image: 'data:image/jpeg;base64,',
      },
      {
        id: 10,
        name: 'The Oberoi',
        location: 'Amarvilas, Agra',
        image: 'data:image/jpeg;base64,',
      },
      {
        id: 11,
        name: 'Vivanta by Taj',
        location: 'Goa',
        image: 'data:image/jpeg;base64,',
      },
      {
        id: 12,
        name: 'Hyatt Regency',
        location: 'Chennai',
        image: 'data:image/jpeg;base64,',
      },
      {
        id: 13,
        name: 'Radisson Blu',
        location: 'Varanasi',
        image: 'data:image/jpeg;base64,',
      },
  ];

  const handleBookNow = (hotelName) => {
    setSelectedHotel(hotelName);
    setShowForm(true);
  };

  const handleSubmit = () => {
    if (name && email && phone && checkIn && checkOut && guests) {
      Alert.alert(
        'Booking Confirmed',
        `Thank you, ${name}! Your booking for ${selectedHotel} is confirmed.`
      );
      // Optionally clear the form
      setName('');
      setEmail('');
      setPhone('');
      setCheckIn('');
      setCheckOut('');
      setGuests('');
      setShowForm(false);
    } else {
      Alert.alert('Error', 'Please fill out all the fields.');
    }
  };

  return (
    <ScrollView contentContainerStyle={styles.container}>
      {!showForm ? (
        <View>
          <Text style={styles.title}>Available Hotels</Text>
          {hotels.map((hotel) => (
            <View key={hotel.id} style={styles.card}>
              <Image source={{ uri: hotel.image }} style={styles.image} />
              <Text style={styles.hotelName}>{hotel.name}</Text>
              <Text style={styles.location}>{hotel.location}</Text>
              <TouchableOpacity
                style={styles.button}
                onPress={() => handleBookNow(hotel.name)}
              >
                <Text style={styles.buttonText}>Book Now</Text>
              </TouchableOpacity>
            </View>
          ))}
        </View>
      ) : (
        <View style={styles.formContainer}>
          <Text style={styles.title}>Booking Form for {selectedHotel}</Text>
          <TextInput
            style={styles.input}
            placeholder="Full Name"
            placeholderTextColor="#ccc"
            value={name}
            onChangeText={setName}
          />
          <TextInput
            style={styles.input}
            placeholder="Email"
            placeholderTextColor="#ccc"
            keyboardType="email-address"
            value={email}
            onChangeText={setEmail}
          />
          <TextInput
            style={styles.input}
            placeholder="Phone Number"
            placeholderTextColor="#ccc"
            keyboardType="phone-pad"
            value={phone}
            onChangeText={setPhone}
          />
          <TextInput
            style={styles.input}
            placeholder="Check-In Date (YYYY-MM-DD)"
            placeholderTextColor="#ccc"
            value={checkIn}
            onChangeText={setCheckIn}
          />
          <TextInput
            style={styles.input}
            placeholder="Check-Out Date (YYYY-MM-DD)"
            placeholderTextColor="#ccc"
            value={checkOut}
            onChangeText={setCheckOut}
          />
          <TextInput
            style={styles.input}
            placeholder="Number of Guests"
            placeholderTextColor="#ccc"
            keyboardType="numeric"
            value={guests}
            onChangeText={setGuests}
          />
          <TouchableOpacity style={styles.button} onPress={handleSubmit}>
            <Text style={styles.buttonText}>Submit</Text>
          </TouchableOpacity>
        </View>
      )}
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  container: {
    flexGrow: 1,
    padding: 20,
    backgroundColor: '#000',
  },
  title: {
    fontSize: 24,
    fontWeight: 'bold',
    color: '#fff',
    marginBottom: 20,
    textAlign: 'center',
  },
  card: {
    marginBottom: 20,
    backgroundColor: '#222',
    padding: 15,
    borderRadius: 10,
  },
  image: {
    width: '100%',
    height: 150,
    borderRadius: 10,
    marginBottom: 10,
  },
  hotelName: {
    fontSize: 18,
    fontWeight: 'bold',
    color: '#fff',
  },
  location: {
    fontSize: 14,
    color: '#ccc',
    marginBottom: 10,
  },
  button: {
    backgroundColor: '#1e90ff',
    padding: 10,
    borderRadius: 5,
    alignItems: 'center',
  },
  buttonText: {
    color: '#fff',
    fontSize: 16,
    fontWeight: 'bold',
  },
  formContainer: {
    marginTop: 20,
  },
  input: {
    width: '100%',
    height: 50,
    borderColor: '#555',
    borderWidth: 1,
    borderRadius: 5,
    paddingHorizontal: 10,
    marginBottom: 15,
    color: '#fff',
    fontSize: 16,
  },
});

export default HotelScreen;
